import React from 'react'
import { useSelector } from 'react-redux'
import CartProduct from './CartProduct';

function Cart() {
  const cart = useSelector(state => state.cart.cart);
  console.log(cart)
  return (
    <div>
      {cart.map((product) => {
        <CartProduct
          id={product.id}
          image={product.thumbnail}
          title={product.title}
          price={product.price}
        />
      })}
    </div>
  )
}

export default Cart
